var app = angular.module('theclub', [
	'theclub.games',
	'theclub.cashbox.controllers',
	'theclub.settings.controllers',
	'theclub.topBar.controllers',
	'nnCustomScrollbar',
	'nnFullHeight',
	'topBar',
	'owlCarousel',
	'ngMockE2E',
	'ct.ui.router.extras',
	'ngCookies'
]);

app.config(function($httpProvider) {
	$httpProvider.defaults.headers.common['X-Requested-With'] = 'XMLHttpRequest';
	$httpProvider.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded';
});

app.run(function($rootScope, Game, Category) {
	$rootScope.Game = Game;
	$rootScope.Category = Category;

	$rootScope.lightbox = {
		_shown: false,
		holder: '#cashbox',
		tabs: '#tabs',
		toggle: function() {
			var $holder = $(this.holder);
			if(this._shown) $holder.hide();
			else $holder.show();

			this._shown = !this._shown;
		},
		toggleTab: function(index) {
			var $tabs = $(this.tabs);

			if(!this._shown) {
				this.toggle(); $tabs.tabs('option', 'active', index);
			} else {
				if($tabs.tabs('option', 'active') === index) this.toggle();
				else $tabs.tabs('option', 'active', index);
			}
		},
		toggleCashbox: function() {
			this.toggleTab(0);
		},
		toggleSettings: function() {
			this.toggleTab(3);
		}
	};
});

